import React from "react";

function Museums() {
    const museums = [
        {
          name: "Government Museum",
          location: "Chennai, Tamil Nadu",
          image: "https://upload.wikimedia.org/wikipedia/commons/thumb/d/d8/Government_Museum_Chennai.jpg/640px-Government_Museum_Chennai.jpg",
        },
        {
          name: "Gandhi Memorial Museum",
          location: "Madurai, Tamil Nadu",
          image: "https://upload.wikimedia.org/wikipedia/commons/thumb/d/d7/Gandhi_Museum_Madurai.jpg/640px-Gandhi_Museum_Madurai.jpg",
        },
        {
          name: "Government Museum",
          location: "Thanjavur, Tamil Nadu",
          image: "https://upload.wikimedia.org/wikipedia/commons/thumb/1/12/Thanjavur_Museum.jpg/640px-Thanjavur_Museum.jpg",
        },
        {
          name: "Fort Museum",
          location: "Chennai, Tamil Nadu",
          image: "https://upload.wikimedia.org/wikipedia/commons/thumb/3/34/Fort_St_George_Museum_Chennai.jpg/640px-Fort_St_George_Museum_Chennai.jpg",
        },
        {
          name: "Vivekananda House Museum",
          location: "Chennai, Tamil Nadu",
          image: "https://upload.wikimedia.org/wikipedia/commons/thumb/f/f5/Vivekananda_House_Chennai.jpg/640px-Vivekananda_House_Chennai.jpg",
        },
      ];
  return (
    <div style={styles.container}>
      <h2 className="text-2xl font-bold text-center mb-8 text-green-800">Explore Tamil Nadu Museums</h2>

      <div style={styles.museumList}>
        {museums.map((museum, index) => (
          <div key={index} style={styles.card}>
            <img src={museum.image} alt={museum.name} style={styles.image} />
            <h2 style={styles.name}>{museum.name}</h2>
            <p style={styles.location}>{museum.location}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

const styles = {
  container: {
    padding: "40px",
    backgroundColor: "#f5f5f5",
    minHeight: "90vh",
  },
  title: {
    textAlign: "center",
    fontSize: "36px",
    marginBottom: "30px",
    color: "#2E8B57",
  },
  museumList: {
    display: "flex",
    justifyContent: "center",
    flexWrap: "wrap",
    gap: "30px",
  },
  card: {
    backgroundColor: "white",
    padding: "20px",
    borderRadius: "12px",
    boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
    width: "250px",
    textAlign: "center",
  },
  image: {
    width: "100%",
    height: "150px",
    objectFit: "cover",
    borderRadius: "10px",
    marginBottom: "15px",
  },
  name: {
    fontSize: "20px",
    color: "#333",
    marginBottom: "5px",
  },
  location: {
    fontSize: "16px",
    color: "#777",
  },
};

export default Museums;
